import { lazy } from 'react'

const UiElementRoutes = [
  {
    path: '/ui-element/typography',
    component: lazy(() => import('../../views/ui-elements/typography'))
  },
  {
    path: '/colors/colors',
    component: lazy(() => import('../../views/ui-elements/colors'))
